import React from 'react';
import Auth from './Auth'
import Home from './Home'
import Protected from './Protected'



const App = ()=>{
    return(
        <>
        <Auth/>
        <Home/>
        <Protected
        home = {<Home/>}
        />
        </>
    )
}


export default App;
